import { BrowserRouter, Routes, Route } from 'react-router-dom';
import UserList from './components/UserList';
import UserForm from './components/UserForm';


function App() {
  return (
    <div className="App">
     <BrowserRouter>
       <Routes>
         <Route path="/" element={<UserList />}/>
         <Route path="/user/new" element={<UserForm />}/>
       </Routes>
     </BrowserRouter>
    </div>
  );
}

export default App;
